import React, { Link, Button } from "react"

class Header extends React.Component {
    render() {
        return (
            <>
                <h1>Teste</h1>
                <ul>
                    <li>

                <a href="/home">Home</a> 
                    </li>
                <a href="/home">Video</a>
                <a href="/home">Photos</a>
                </ul>

            </>
        )
    }
}

export default Header;
